{"title":"vega-data-quality","type":"vega","params":{"spec":"{
  $schema: https://vega.github.io/schema/vega/v3.json
  padding: 5
  title: {text: "Event A and not event B and total entities/doc count", anchor: "start", offset: 4}
  data: [
    {
    // query ES based on the currently selected time range and filter string
      name: summary
      url: {
