                  }
                }
                eventphasing: {
                  filters: {
                    filters: {
                      virus: {
                        query_string: {query: "CategoryName.keyword:\"VODKA 80 PROOF\""}
                      }
                    }
                  }
                  aggs: {
                    earliest: {
                      min: {field: "DateofSale"}
                    }
                    latest: {
                      max: {field: "DateofSale"}
                    }
                    gap: {
                      bucket_script: {
                        buckets_path: {earliest: "earliest", latest: "latest"}
                        script: params.latest-params.earliest
                      }
                    }
                  }
                }
                overall_realearliest: {
                  min_bucket: {buckets_path: "eventanchor>earliest"}
