                }
                overall_latest: {
                  max_bucket: {buckets_path: "eventphasing>latest"}
                }
                overall_gap: {
                  max_bucket: {buckets_path: "eventphasing>gap"}
                }
                kick_out_low_scores: {
                  bucket_selector: {
                    buckets_path: {
                      real_first: overall_realearliest
                      real_last: overall_reallatest
                      first: overall_earliest
                      last: overall_latest
                      gap: overall_gap
                    }
                    script: params.real_first > 0 && params.real_last >0 && params.first.isNaN() && params.last.isNaN()
